import * as React from 'react';
function SingleMovieSvg(props: React.SVGProps<SVGSVGElement>) {
  return (
<svg xmlns="http://www.w3.org/2000/svg" width="400" height="300">
  <rect width="100%" height="100%" fill="white" />
  <text x="50%" y="50%" fill="black" text-anchor="middle" font-size="24">Your Video Content</text>
</svg>
  );
}
export default SingleMovieSvg;
